import bookContext from "../../context/BookContext";

import "./index.css";

const Library = () => {
  return (
    <div className="Library-page">
      <h1 className="savedBooks">Saved Books</h1>
      <div className="container-div-Library">
        <ul className="container-Library">
          <li>hello</li>
        </ul>
      </div>
    </div>
  );
};

export default Library;
